import { styledOptions, system } from '@codecademy/gamut-styles';
import { transformSize, variance } from '@codecademy/variance';
import styled from '@emotion/styled';
export var iconProps = variance.compose(system.layout, system.color, system.space, system.positioning, system.border, variance.create({
  size: {
    property: 'width',
    properties: ['width', 'height'],
    transform: transformSize
  }
}));
export var Svg = styled('svg', styledOptions())(iconProps);
Svg.defaultProps = {
  width: 16,
  height: 16
};
